INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COLL', 'STOCK', 'Collegium Pharmaceutical, Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Collegium Pharmaceutical, Inc. is a diversified biopharmaceutical company. The Company has developed, licensed, and acquired a portfolio of products for use in the treatment of attention deficit hyperactivity disorder (ADHD) and moderate to severe pain. Its commercial products include Jornay PM (Jornay), Belbuca, Xtampza ER (Xtampza), Nucynta ER and Nucynta IR (Nucynta Products), and Symproic in the United States. Its Jornay is a central nervous system (CNS) stimulant prescription medicine for the treatment of ADHD. The Belbuca is a buccal film that contains buprenorphine for severe and persistent pain. Xtampza ER is an abuse-deterrent, extended-release, oral formulation of oxycodone. The Xtampza ER is a pain treatment option designed with abuse deterrent properties. The Nucynta Products are ER and IR oral formulations of tapentadol. Nucynta ER is indicated for the management of severe and persistent pain that requires an extended treatment period with a daily opioid analgesic.', 'Stoughton, MA, United States', 357);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRGO', 'STOCK', 'Freightos Limited', 'NCM', 'Industrials', 'Integrated Freight & Logistics', 'Freightos Limited provides a vendor-neutral booking and payment platform. The Company connects thousands of carriers, freight forwarders, and importers and exporters around the world for air, ocean and trucking freight pricing, booking and shipment management. Its products include the Freightos Marketplace, WebCargo, WebCargo for Airlines, Shipsta by Freightos, 7LFreight by WebCargo, and Clearit. It provides a range of solutions, including WebCargos booking platform, tools and data solutions for carriers and forwarders, Freightos.coms digital freight booking and management platform for importers and exporters, its data solutions or Clearit, its digital customs broker. It also operates Freightos Terminal, a freight market intelligence solution that offers data on real-time pricing, transit times, the Freightos Air Index (FAX) and Freightos Baltic Index, and a news feed. It has over 1,800 freight forwarders across 90 countries that use WebCargo by Freightos for eBookings.', 'Barcelona, , Spain', 378);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVBP', 'STOCK', 'ArriVent BioPharma, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'ArriVent BioPharma, Inc. is a clinical-stage biopharmaceutical company dedicated to the identification, development, and commercialization of differentiated medicines to address the unmet medical needs of patients with cancers. The Company is focused on maximizing the potential of its lead development candidate, firmonertinib, and advancing a pipeline of novel therapeutics, such as antibody drug conjugates (ADCs), through approval and commercialization. Firmonertinib is an oral, highly brain-penetrant, and broadly active mutation-selective epidermal growth factor receptor (EGFR) inhibitor active against both classical and uncommon EGFR mutations, including PACC and exon 20 insertion mutations. Firmonertinib is also being studied in a clinical combination study targeting advanced or metastatic NSCLC patients with EGFR classical mutations. It is developing ARR-217, an ADC for the treatment of gastrointestinal cancers. Its ARR-002 candidate is focused on the treatment of solid tumors.', 'Newtown Square, PA, United States', 52);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLFS', 'STOCK', 'BioLife Solutions, Inc.', 'NCM', 'Healthcare', 'Medical Instruments & Supplies', 'BioLife Solutions, Inc. is a developer and supplier of cell processing tools and services for the cell and gene therapy (CGT) market. The Company facilitates the commercialization of new therapies by supplying solutions that maintain the health and function of biologic materials during collection, development, manufacturing and distribution. Its CryoStor freeze media and HypoThermosol hypothermic storage media are optimized to preserve cells in the regenerative medicine market. Its Sexton cell processing product line includes human platelet lysates (hPL) for cell expansion. Its CellSeal cryogenic vials, which are rigid containers used in cell and gene therapy (CGT). Its CryoCase cryo-compatible transparent rigid containers are designed for closed-system fill and retrieval, and automated cell processing machines. The Companys ThawSTAR product line is composed of a family of automated thawing devices for frozen cell and gene therapies packaged in cryovials and cryobags.', 'Bothell, WA, United States', 159);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EPM', 'STOCK', 'Evolution Petroleum Corporation', 'ASE', 'Energy', 'Oil & Gas E&P', 'Evolution Petroleum Corporation is an independent energy company. The Company is focused on ownership of and investment in onshore oil and natural gas properties in the United States. Its oil and natural gas properties consist of non-operated interests in the SCOOP and STACK plays of the Anadarko Basin located in central Oklahoma; the Chaveroo oilfield in Chaves and Roosevelt Counties of New Mexico; the Jonah Field in Sublette County, Wyoming; the Williston Basin in North Dakota; the Barnett Shale located in North Texas; the Hamilton Dome Field located in Hot Springs County, Wyoming; the Delhi Holt-Bryant Unit in the Delhi Field in Northeast Louisiana; as well as small overriding royalty interests in four onshore central Texas wells. Its non-operated interests in the SCOOP and STACK plays, consist of oil and natural gas producing properties in the Anadarko basin, where it holds approximately 2.6% average net working interest.', 'Houston, TX, United States', 11);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVEO', 'STOCK', 'Civeo Corporation', 'NYQ', 'Consumer Cyclical', 'Lodging', 'Civeo Corporation is engaged in providing hospitality services. The Companys segments include Canada and Australia. The Company offers hospitality services for its guests in the natural resources industry, including lodging, catering and food service, housekeeping and maintenance at accommodation facilities. It provides services that support the day-to-day operations of these facilities, such as laundry, facility management and maintenance, water and wastewater treatment, power generation, communication systems, security and logistics. It also manages development activities for workforce accommodation facilities, including site selection, permitting, engineering and design, manufacturing management and site construction, along with providing hospitality services once the facility is constructed. It owns and operates 28 lodges and villages with over 27,500 rooms. In Canada, it also offers a fleet of mobile assets which serve shorter term projects, such as pipeline construction.', 'Houston, TX, United States', 2600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIPI', 'STOCK', 'REX AI Equity Premium Income ETF', 'NGM', NULL, NULL, 'The fund, under normal market conditions, invests at least 80% of its net assets (plus any borrowings for investment purposes) in securities comprising the BITA AI Leaders Select Index. It seeks to employ its investment strategy regardless of whether there are periods of adverse market, economic, or other conditions and will not seek to take temporary defensive positions during such periods. The fund is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRVL', 'STOCK', 'CorVel Corporation', 'NMS', 'Financial Services', 'Insurance Brokers', 'CorVel Corporation applies technology, including artificial intelligence, machine learning and natural language processing, to enhance the management of episodes of care and the related health-care costs. The Company partners with employers, third-party administrators, insurance companies and government agencies to assist its customers in managing the medical costs of workers compensation, group health and auto insurance, and in monitoring the quality of care provided to claimants. Its services include claims management, bill review, preferred provider networks, utilization management, case management, pharmacy services, directed care and Medicare services. It delivers its solutions in three ways - as a fully integrated claims-management program, as discrete standalone services, or as targeted add-ons that enhance an existing client workflow. Integrated, end-to-end bundled programs are designed primarily for buyers such as self-insured employers who want a single, turnkey partner.', 'Fort Worth, TX, United States', 5075);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNDW', 'STOCK', 'Vanguard Total World Bond ETF', 'NGM', NULL, NULL, 'The fund is a fund of funds and employs an indexing investment approach designed to track the performance of the index, which is a custom, USD-hedged index designed to track the market capitalized weights of the global investment-grade bond market and is comprised of the Bloomberg U.S. Aggregate Float Adjusted Index and the Bloomberg Global Aggregate ex-USD Float Adjusted RIC Capped Index.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELUT', 'STOCK', 'Elutia Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Elutia Inc. is a commercial-stage company, which has developed a portfolio of products using both human and porcine tissue. Its portfolio of products spans the Device Protection, Womens Health and Cardiovascular markets. These products are primarily sold to healthcare providers or commercial partners. In Device Protection, it sells CanGaroo, a biological envelope, that is indicated for use with implantable electronic devices, including cardiac and neurostimulator devices. In Womens Health, it has developed both patented and proprietary technologies, culminating in the creation of SimpliDerm, a biological matrix designed to leverage the inherent science of natural healing processes. In Cardiovascular, it sells its specialized porcine small intestine submucosa, which is also the tissue used to make CanGaroo, for use as an intracardiac and vascular patch, as well as for pericardial reconstruction. In addition, its TYKE product is designed for use in the neonatal patient population.', 'Silver Spring, MD, United States', 51);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBN', 'STOCK', 'BlackRock Taxable Municipal Bond Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Taxable Municipal Bond Trust is a closed-ended fixed income mutual fund launched by BlackRock, Inc. It is managed by BlackRock Advisors, LLC. The fund invests in the fixed income markets of the United States. It primarily invests in taxable municipal securities, which include Build America Bonds. The fund also invests in tax-exempt securities, U.S. treasury securities, obligations of the U.S. government, its agencies and instrumentalities, and corporate bonds. It was formerly known as BlackRock Build America Bond Trust. BlackRock Taxable Municipal Bond Trust was formed on August 27, 2010 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVO', 'STOCK', 'Mission Produce, Inc.', 'NMS', 'Consumer Defensive', 'Food Distribution', 'Mission Produce, Inc. is engaged in the farming, packaging, marketing, and distribution of avocados to food retailers, distributors and produce wholesalers. It operates through three segments: Marketing and Distribution, International Farming, and Blueberries. Its Marketing and Distribution segment sources fruit from growers and then distributes the fruit through its global distribution network. Its International Farming segment owns and operates orchards from which all fruit produced is sold to its Marketing and Distribution segment. Its farming activities range from cultivating early-stage plantings to harvesting from mature trees. Its Blueberries segment is a farming operation that cultivates blueberry plants in Peru. It provides value-added services including ripening, bagging, custom packaging, logistical management, and quality assurance. The Company also provides its customers with merchandising and promotional support, insights on market trends and hands-on training.', 'Oxnard, CA, United States', 3100);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLIN', 'STOCK', 'Bridgeline Digital, Inc.', 'NCM', 'Technology', 'Software - Infrastructure', 'Bridgeline Digital, Inc. is a marketing technology company. The Company offers a suite of products that help companies grow online revenue by driving more traffic to their Websites, converting more visitors to purchasers, and increasing average order value. The Companys product offerings include HawkSearch, Celebros Search, Woorank, Unbound, TruPresence, and OrchestraCMS. The HawkSearch is a site search, recommendation, and personalization software application, built for marketers, merchandisers, and developers to enhance, normalize, and enrich an online customer''s content search and product discovery experience. The Celebros Search is a commerce-oriented site search product that provides natural language processing with artificial intelligence to present relevant search results based on long-tail keyword searches. The Woorank is a search engine optimization (SEO) audit tool that generates an instant performance audit of the sites technical, on-page, and off-page SEO.', 'Woburn, MA, United States', 51);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ELP', 'STOCK', 'Companhia Paranaense de Energia - COPEL', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'A Companhia Paranaense de Energia, também conhecida como Copel, é uma empresa brasileira de energia elétrica. As atividades do escritório estão divididas em cinco segmentos: Geração e Transmissão de Energia (GET); Distribuição e Vendas de Energia (DIS); Telecomunicações (TEL); Gás; e Holding (HOL). O segmento GET inclui a geração de energia elétrica a partir de projetos hidráulicos, eólicos e térmicos; o transporte e transformação da energia gerada pela Companhia; e a construção, operação e manutenção de todas as subestações e linhas de transmissão de energia. O segmento DISs está focado na distribuição e venda de energia elétrica, e na operação e manutenção da infraestrutura de distribuição. O segmento TEL presta serviços de telecomunicações. O segmento de Gás está envolvido no serviço público de distribuição de gás natural canalizado. O SEGMENTO HOL consiste na participação em outras empresas. A Companhia atua no estado do Paraná.', 'Curitiba, PR, Brazil', 4396);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DATS', 'STOCK', 'Myseum, Inc.', 'NCM', 'Technology', 'Software - Application', 'DatChat, Inc. is a secure messaging and social media company that focuses on protecting privacy on personal devices and protects user information after it is shared with others. Its flagship product, DatChat Messenger & Private Social Network, is a privacy platform and mobile application that gives users the ability to communicate with the privacy and protection they deserve. DatChat Messenger & Private Social Network presents technology that allows users to change how long their messages can be viewed before or after users send them, prevents screenshots, and hides encrypted photos in plain sight on camera rolls. Its technology offers users a traditional texting experience while providing control and security for their messages. With the DatChat Messenger, a user can decide how long their messages last on a recipient''s device, while feeling secure that at any time, they can delete individual messages or entire message threads, making it like the conversation never happened.', 'New Brunswick, NJ, United States', 10);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHI', 'STOCK', 'Calamos Convertible Opportunities and Income Fund', 'NGM', 'Financial Services', 'Asset Management', 'Calamos Convertible Opportunities and Income Fund is a closed ended fixed income mutual fund launched by Calamos Investments LLC. It is managed by Calamos Advisors LLC. The fund invests in the fixed income markets of the United States. It primarily invests in a diversified portfolio of convertible securities and high yield corporate bonds rated Ba or lower by Moody''s or BB or lower by Standard & Poor''s. The fund employs both fundamental and quantitative analysis with a focus on such factors as financial soundness, ability to make interest and dividend payments, earnings and cash-flow forecast, and quality of management to create its portfolio. Calamos Convertible Opportunities and Income Fund was formed on April 17, 2002 and is domiciled in the United States.', 'Naperville, IL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALRM', 'STOCK', 'Alarm.com Holdings, Inc.', 'NMS', 'Technology', 'Software - Application', 'Alarm.com Holdings, Inc. provides a platform for intelligently connected property. Its cloud-based platform offers a suite of Internet of Things (IoT) solutions addressing global opportunities in the residential, multi-family, small business and enterprise commercial markets. The Company''s segments include Alarm.com and Other. Its Alarm.com segment represents its cloud-based and Software platforms for intelligently connected property and related solutions. Its Other segment is focused on researching, developing and offering residential and commercial automation solutions and energy management products and services in adjacent markets. Its platform integrates with a growing variety of IoT devices through its apps and interfaces. Its solution suite includes security, video and video analytics, energy management, access control, electric utility grid management, indoor gunshot detection, water management, health and wellness, personal safety and data-rich emergency response.', 'Tysons, VA, United States', 2048);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AURA', 'STOCK', 'Aura Biosciences, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Aura Biosciences, Inc. is a clinical-stage biotechnology company focused on developing precision therapies for solid tumors that aim to preserve organ function. The Companys lead candidate, bel-sar (AU-011), is in late-stage development for primary choroidal melanoma and in early-stage development in other ocular oncology indications and bladder cancer. It is developing bel-sar as a potential first-line vision-sparing treatment option for early intervention in small choroidal melanoma and/or indeterminate lesions, avoiding the need for radiotherapy and reducing the risk for metastasis for these patients. Bel-sar is a virus-like drug conjugate (VDC) consisting of a human papillomavirus (HPV)-derived virus-like particle (VLP) and a phthalocyanine dye, a light-activated cytotoxic payload. The Companys platform is designed to enable the targeting of a broad range of solid tumors using VLP, that can be conjugated with drugs or loaded with nucleic acids to create VDCs.', 'Boston, MA, United States', 106);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACDC', 'STOCK', 'ProFrac Holding Corp.', 'NMS', 'Energy', 'Oil & Gas Equipment & Services', 'ProFrac Holding Corp. is a technology-focused, vertically integrated energy services holding company. The Company provides hydraulic fracturing, proppant production, related completion services and complementary products and services to upstream oil and natural gas companies engaged in the exploration and production (E&P) of North American unconventional oil and natural gas resources. Its Stimulation Services segment, which primarily relates to ProFrac LLC, owns and operates a fleet of mobile hydraulic fracturing units and other auxiliary equipment that provides stimulation services to its customers. Its Proppant Production segment, which primarily relates to Alpine, provides proppant to oilfield service providers and E&P companies. The Manufacturing segment sells products such as high horsepower pumps, valves, piping, swivels, large-bore manifold systems, and fluid ends. Its other business activities include Livewire Power, LLC, which enables onsite power generation services.', 'Willow Park, TX, United States', 3077);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALAR', 'STOCK', 'Alarum Technologies Ltd.', 'NCM', 'Technology', 'Software - Infrastructure', 'Alarum Technologies Ltd, formerly known as Safe-T Group Ltd, is an Israel-based company engaged primarily in the provision of data collection software for enterprises. The Company operates two business segments: the Enterprise Internet Access and Web Data Collection segment and the Consumer Internet Access Solutions and Services segment. In the Enterprise Internet Access and Web Data Collection segment, the Company offers a Web Data Collection Service for enterprises that is based on the Company''s proxy traffic optimization and routing technology, as well as partnership agreements with Internet providers. In the Consumer Internet Access Solutions and Services segment, the Company offers secured and encrypted connections for individual customers. The Company operates on a Software as a Service (SaaS) business model, offering its software on a fee basis.', 'Tel Aviv, , Israel', 68);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MSA', 'STOCK', 'MSA Safety Incorporated', 'NYQ', 'Industrials', 'Security & Protection Services', 'MSA Safety Incorporated provides advanced safety products, technologies and solutions. The Company''s product line is used to protect workers and facility infrastructures. Its product categories are fire service, detection and industrial personal protective equipment (PPE). Its products for fire service include self-contained breathing apparatus (SCBA), protective apparel and helmets; products for detection include fixed gas and flame detection systems and portable gas detection instruments; and products for industrial PPE include industrial head protection and fall protection devices. Its segments include Americas, International and Corporate. The Company serves its markets across the Americas with manufacturing facilities in the United States, Mexico and Brazil. The International segment includes companies in Europe, the Middle East and Africa, and the Asia Pacific region. It offers a complete line of industrial head protection and accessories that includes the V-Gard helmet brand.', 'Cranberry Township, PA, United States', 5000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCC', 'STOCK', 'Boise Cascade Company', 'NYQ', 'Basic Materials', 'Lumber & Wood Production', 'Boise Cascade Company is a producer of engineered wood products (EWP) and plywood in North America and a wholesale distributor of building products in the United States. Its segments include Wood Products and Building Materials Distribution. The Wood Products segment manufactures laminated veneer lumber (LVL), I-joists, and laminated beams. In addition, it manufactures structural, appearance, and industrial plywood panels, and ponderosa pine lumber. The Building Materials Distribution segment operates a network of distribution facilities that sell a broad line of building materials, including oriented strand board (OSB), plywood, and lumber, and general line items, such as siding, composite decking, doors and millwork, metal products, roofing, and insulation. Its products are used in the construction of new residential housing, including single-family, multi-family, and manufactured homes, the construction of light industrial and commercial buildings, and industrial applications.', 'Boise, ID, United States', 7710);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CACI', 'STOCK', 'CACI International Inc', 'NYQ', 'Technology', 'Information Technology Services', 'A CACI International Inc (CACI) é uma holding, que opera através de suas subsidiárias localizadas nos Estados Unidos e na Europa. É uma provedora de expertise e tecnologia diferenciada para clientes em apoio à segurança nacional nos setores de inteligência, defesa e civil federal. Seus segmentos incluem Operações Domésticas e Operações Internacionais. O segmento de Operações Domésticas fornece expertise e tecnologia para agências governamentais federais dos EUA. O segmento de Operações Internacionais fornece expertise e tecnologia para o governo internacional e clientes comerciais. Ele fornece uma mistura diversificada de SERVIÇOS DE TI e dados proprietários e produtos de software, servindo clientes comerciais e governamentais em todo o Reino Unido, Europa continental e em todo o mundo. Suas ofertas de software consistem em inteligência de sinais (SIGINT), guerra eletrônica (EW) e inteligência, vigilância e reconhecimento (ISR), em vários domínios, plataformas e conjuntos de clientes.', 'Reston, VA, United States', 25000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSJP', 'STOCK', 'Invesco BulletShares 2025 High Yield Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated high yield corporate bonds (commonly known as "junk bonds") with maturities or, in some cases, "effective maturities" in the year 2025 (collectively, "2025 Bonds").', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMTB', 'STOCK', 'Amerant Bancorp Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Amerant Bancorp Inc. is a bank holding company. The Company operates through its subsidiary, Amerant Bank, N.A. (the Bank). It provides individuals and businesses with a comprehensive array of deposit, credit, investment, wealth management, retail banking, mortgage services and fiduciary services. It offers a variety of trust and estate planning products and services catering to high-net-worth customers. Its trust and estate planning products include simple and complex trusts, private foundations and personal investment companies. It offers a full suite of online banking services, including online account opening for domestic and international customers, access to account balances, statements and other documents, Zelle for consumers and businesses, online transfers, online bill payment and electronic delivery of customer statements, as well as automated teller machines, and banking by mobile devices, telephone and mail.', 'Coral Gables, FL, United States', 692);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZO', 'STOCK', 'AutoZone, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'A AutoZone, Inc. É uma Varejista e distribuidora de peças de reposição e acessórios automotivos nas Américas. Seu segmento de Auto Parts Stores é Varejista e distribuidora de peças automotivas e acessórios por meio de suas aproximadamente 7 353 lojas nos Estados Unidos, México e Brasil. Cada loja possui uma extensa linha de produtos para carros, veículos utilitários esportivos, vans e caminhões leves, incluindo peças automotivas novas e remanufaturadas, itens de manutenção, acessórios e produtos não automotivos. A empresa também vende peças automotivas, itens de manutenção, acessórios e produtos não automotivos através de www.autozone.com, e seus clientes comerciais podem fazer compras através de www.autozonepro.com. Além disso, a empresa vende a marca ALLDATA de software automotivo de diagnóstico, reparo, colisão e gerenciamento de lojas através de www.alldata.com. Também fornece informações sobre os produtos da marca Duralast através de www.duralastparts.com.', 'Memphis, TN, United States', 75600);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADGM', 'STOCK', 'Adagio Medical Holdings, Inc.', 'NCM', 'Healthcare', 'Medical Devices', 'Adagio Medical Holdings, Inc. is a commercial stage medical device company. It is focused on developing proprietary Ultra-Low Temperature Cryoablation technology that creates contiguous, transmural lesions to treat cardiac arrhythmias, with an emphasis on ventricular tachycardia. It is developing and placing on the European Union (EU) market ablation technologies for the treatment of cardiac arrhythmias, including atrial fibrillation, atrial flutter, and ventricular tachycardia. Its product portfolio consists of three product families: iCLAS atrial ULTC catheter and accessories, vCLAS ventricular ULTC catheter, and Cryopulse atrial PFCA catheter and accessories. All of these catheters share the same ULTC cryoablation console. The iCLAS system is CE-marked with the indication for treatment of paroxysmal atrial fibrillation, persistent atrial fibrillation and atrial flutter. The vCLAS ventricular catheter has been specifically designed for the treatment of ventricular arrhythmia.', 'Laguna Hills, CA, United States', 80);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSTL', 'STOCK', 'Castle Biosciences, Inc.', 'NGM', 'Healthcare', 'Diagnostics & Research', 'Castle Biosciences, Inc. is a diagnostics company improving health through tests that guide patient care. The Companys portfolio consists of tests for skin cancers, Barretts esophagus, mental health conditions and uveal melanoma. Additionally, the Company has active research and development programs for tests in these and other diseases with high clinical need, including its test in development to help guide systemic therapy selection for patients with moderate-to-severe atopic dermatitis seeking biologic treatment. Its products include DecisionDx-Melanoma, DecisionDx-SCC, MyPath Melanoma, TissueCypher, IDgenetix, and DecisionDx-UM. DecisionDx-Melanoma is its risk stratification gene expression profile (GEP) test that predicts the likelihood of positive sentinel lymph node and the risk of metastasis, or recurrence, for patients diagnosed with invasive cutaneous melanoma (CM). DecisionDx-SCC is its GEP test for use in patients with cutaneous squamous cell carcinoma (SCC).', 'Friendswood, TX, United States', 798);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BFRI', 'STOCK', 'Biofrontera Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Biofrontera Inc. is a biopharmaceutical company. The Company is focused on commercializing a portfolio of pharmaceutical products for the treatment of dermatological conditions with a focus on photodynamic therapy (PDT) and topical antibiotics. The Company''s licensed products are used for the treatment of actinic keratoses, which are pre-cancerous skin lesions, as well as impetigo, a bacterial skin infection. Its principal licensed product is Ameluz, which is a prescription drug for use in combination with the BF-RhodoLED lamp series, for photodynamic therapy. In the United States, the PDT treatment is used for the lesion-directed and field-directed treatment of actinic keratoses (AK) of mild-to-moderate severity on the face and scalp. Its second prescription drug licensed product in its portfolio is Xepi, which is a topical non-fluorinated quinolone that inhibits bacterial growth and is used for the treatment of impetigo due to Staphylococcus aureus or Streptococcus pyogenes.', 'Woburn, MA, United States', 92);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRBS', 'STOCK', 'Blue Ridge Bankshares, Inc.', 'ASE', 'Financial Services', 'Banks - Regional', 'Blue Ridge Bankshares, Inc. is the holding company of Blue Ridge Bank, National Association (the Bank) and BRB Financial Group, Inc. (the Financial Group). The Company''s segments include commercial banking, mortgage banking and holding company activities. The Bank serves businesses, professionals, consumers, nonprofits, and municipalities with a wide variety of financial services, including retail and commercial banking, and mortgage banking lending. Banking products include checking accounts, savings accounts, money market accounts, cash management accounts, certificates of deposit, commercial and industrial loans, residential mortgages, commercial mortgages, home equity loans, credit cards, online banking, telephone banking, and mobile banking. The Company, through the Financial Group, offers investment and wealth management and management services for personal and corporate trusts, including estate planning, estate settlement, trust administration, and life insurance products.', 'Richmond, VA, United States', 416);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCAL', 'STOCK', 'California BanCorp.', 'NCM', 'Financial Services', 'Banks - Regional', 'California BanCorp is the holding company for California Bank of Commerce, N.A. (the Bank). The Bank offers a range of financial products and services to individuals, professionals, and small to medium-sized businesses through its approximately 14 branch offices and four loan production offices serving Northern and Southern California. Its business financing includes lines of credit, capital equipment, and mergers and acquisitions-ownership transitions. Its commercial real estate and construction includes owner-occupied real estate, investor real estate, equity lines and loans, and construction financing. It provides various services, including lockbox, merchant services, and cash vault. It also provides information reporting and liquidity management, mobile banking, online banking, commercial cards, integrated payables, a cash reconciliation app, and fraud prevention. Its international banking includes import, standby, and export letters of credit.', 'San Diego, CA, United States', 290);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCSF', 'STOCK', 'Bain Capital Specialty Finance, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Bain Capital Specialty Finance, Inc. is an externally managed specialty finance company focused on lending to middle market companies. The Company''s investment objective is to generate current income and, to a lesser extent, capital appreciation through direct originations of secured debt, including first lien, first lien/last out, unitranche and second lien debt, investments in strategic joint ventures, equity investments and, to a lesser extent, corporate bonds. Its primary focus is capitalizing on opportunities within Bain Capital Credit''s Senior Direct Lending Strategy, which seeks to provide risk-adjusted returns and current income to investors by investing primarily in middle-market direct lending opportunities across North America, Europe and Australia and also in other geographic markets. It may also invest in mezzanine debt and other junior securities, including common and preferred equity and in secondary purchases of assets or portfolios. It is managed by BCSF Advisors, LP', 'Boston, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DRCT', 'STOCK', 'Direct Digital Holdings, Inc.', 'NCM', 'Communication Services', 'Advertising Agencies', 'Direct Digital Holdings, Inc. is a holding company that provides an end-to-end, programmatic advertising platform. The Company is primarily focused on providing advertising technology, data-driven campaign optimization and other solution to help brands, agencies and middle market businesses deliver marketing results that drive return on investment across both the sell- and buy-side of the digital advertising ecosystem. Through its subsidiary, Colossus Media, LLC, operates its sell-side programmatic platform operating under the trademarked banner of Colossus SSP, offers advertisers of all sizes with market reach. Its subsidiaries, Huddled Masses, LLC and Orange142, LLC, are buy-side advertising and marketing service providers. Its buy-side advertising business offers technology-enabled advertising solutions and consulting services to clients through multiple demand side platforms, across multiple industry verticals such as travel and tourism, energy, higher education, and other sectors.', 'Houston, TX, United States', 79);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BCX', 'STOCK', 'Blackrock Resources & Commodities Strategy Trust', 'NYQ', 'Financial Services', 'Asset Management', 'Blackrock Resources & Commodities Strategy Trust is a closed-ended equity mutual fund launched by BlackRock, Inc. It is co-managed by BlackRock Advisors, LLC and BlackRock International Limited. The fund invests in the public equity markets of the United States. It seeks to invest in stocks of companies operating in the commodities or natural resources sectors. The fund also invests through derivatives with exposure to commodity or natural resources companies, with an emphasis on option writing. Blackrock Resources & Commodities Strategy Trust was formed on March 30, 2011 and is domiciled in the United States.', 'New York, NY, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHLB', 'STOCK', 'Berkshire Hills Bancorp, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Berkshire Hills Bancorp, Inc. is a holding company for Berkshire Bank (the Bank). The Bank provides commercial banking, retail banking, consumer lending, private banking and wealth management services. The Bank provides various loans, including commercial real estate, commercial and industrial loans, residential mortgages and consumer loans. The Bank originates commercial real estate loans on properties used for business purposes, such as retail, multifamily, office, healthcare, hospitality, industrial and manufacturing facilities. The Bank is engaged in prime home equity lending, following its conforming mortgage underwriting guidelines with streamlined verifications and documentation. The Bank offers fixed-rate and adjustable-rate residential mortgage loans. The Company''s Wealth Management Group provides consultative investment management, trust administration, and financial planning to individuals, businesses, and institutions, with an emphasis on personal investment management.', 'Boston, MA, United States', 1158);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DUOT', 'STOCK', 'Duos Technologies Group, Inc.', 'NCM', 'Technology', 'Software - Application', 'Duos Technologies Group, Inc., through its wholly owned subsidiary, Duos Technologies, Inc., designs, develops, deploys, and operates intelligent vision-based technology solutions using machine vision and artificial intelligence (AI) to analyze fast moving freight, passenger and transit trains and trucks streamlining operations, improving safety, and reducing costs. The Company provides solutions that automate the mechanical and security inspection of fast-moving trains, trucks, and automobiles through a broad range of hardware, software, information technology and AI. Its Railcar Inspection Portal (RIP) provides both freight and transit railroad customers and select government agencies the ability to conduct fully remote railcar inspections of trains while they are moving at full speed. It has also developed the automated logistics information system (ALIS) which automates gatehouse operations where transport trucks enter and exit large logistics and intermodal facilities.', 'Jacksonville, FL, United States', 79);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACFN', 'STOCK', 'Acorn Energy, Inc.', 'NCM', 'Technology', 'Scientific & Technical Instruments', 'Acorn Energy, Inc. is a holding company. The Company is focused on providing technology solutions for energy infrastructure asset management. The Company provides products and Internet of Things (IoT) applications and services through its OmniMetrix, LLC (OmniMetrix) subsidiary. Its segment includes Power Generation (PG) and Cathodic Protection (CP). The Power Generation segment provides wireless remote monitoring and control systems and IoT applications for residential and commercial/industrial power generation equipment. The PG segment includes its AIRGuard product, which remotely monitors and controls industrial air compressors, and its Smart Annunciator product. The Cathodic Protection segment provides remote monitoring and control products for cathodic protection systems on oil and gas pipelines serving the gas utilities market and pipeline operators. Its Cathodic Protection product lineup includes solutions to remotely monitor and control rectifiers, test stations and bonds.', 'Wilmington, DE, United States', 25);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APVO', 'STOCK', 'Aptevo Therapeutics Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Aptevo Therapeutics Inc. is a clinical-stage biotechnology company focused on developing novel bispecific immunotherapies for the treatment of cancer. The Company has two clinical candidates: Mipletamig and ALG.APV-527. Mipletamig is being evaluated in RAINIER, a two-part Phase 1b/2 trial for the treatment of frontline acute myeloid leukemia in combination with standard-of-care venetoclax + azacitidine. Mipletamig has received orphan drug designation for AML according to the Orphan Drug Act. ALG.APV-527, a bispecific conditional 4-1BB agonist, only active upon simultaneous binding to 4-1BB and 5T4, is being co-developed with Alligator Bioscience and is being evaluated in a Phase 1 clinical trial for the treatment of multiple solid tumor types likely to express 5T4. The Company has three pre-clinical candidates with different mechanisms of action designed to target a range of solid tumors. All pipeline candidates are created from two proprietary platforms, ADAPTIR and ADAPTIR-FLEX.', 'Seattle, WA, United States', 37);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLOA', 'STOCK', 'iShares AAA CLO Active ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing, under normal circumstances, at least 80% of its assets in U.S. dollar-denominated CLOs that are, at the time of purchase, rated AAA (or equivalent) by at least one of the major rating agencies or, if unrated, determined by the fund management team to be of similar quality. The fund may invest in CLOs of any maturity. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANIX', 'STOCK', 'Anixa Biosciences, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Anixa Biosciences, Inc. is a clinical-stage biotechnology company focused on the treatment and prevention of cancer. The Company''s therapeutic portfolio consists of an ovarian cancer immunotherapy program being developed in collaboration with Moffitt Cancer Center, which uses a novel type of CAR-T, known as chimeric endocrine receptor-T cell (CER-T) technology. The Company''s vaccine portfolio includes vaccines being developed in collaboration with Cleveland Clinic to treat and prevent breast cancer and ovarian cancer, as well as additional cancer vaccines to address many intractable cancers, including high incidence malignancies in lung, colon, and prostate. The Company is engaged in the development of vaccines for the treatment or prevention of triple negative breast cancer and other breast cancers which express the a-lactalbumin protein. Its vaccine technologies are focused on immunizing against retired proteins that have been found to be expressed in certain forms of cancer.', 'San Jose, CA, United States', 5);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLW', 'STOCK', 'Clearwater Paper Corporation', 'NYQ', 'Basic Materials', 'Paper & Paper Products', 'Clearwater Paper Corporation is an independent supplier of solid bleached sulfate (SBS) paperboard packaging products to North American converters. The Company produces quality paperboards that provides sustainable packaging solutions for consumer goods and food service applications. The Company operates through Pulp and Paperboard segment. It supplies bleached paperboard to quality-conscious printers and packaging converters, and offers services that include custom sheeting, slitting and cutting. SBS paperboard is a premium paperboard grade that is used to produce folding cartons (also includes blister and carded packaging and top sheet), food service (including liquid packaging, cups and plates) and commercial printing items. It produces paperboard that is then converted and printed by independent converters and primarily used in folding carton and food service applications. Food service paperboard includes both liquid packaging and cup and plate categories.', 'Spokane, WA, United States', 2200);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NWGL', 'STOCK', 'Nature Wood Group Limited', 'NCM', 'Basic Materials', 'Lumber & Wood Production', 'Nature Wood Group Ltd is a company primarily engaged in the manufacture and sale of wood products. The Company operates business through two segment. The Direct Purchase and Original Design Manufacturer (ODM) segment is engaged in the sourcing of live wood and owning designed design on wood products for sales to end customers. The Manufacturing segment is engaged in the manufacturing of decking, flooring or sawn timbers. The Company is engaged in the manufacture and sale of logs, decking, floorings, sawn timbers, recycled charcoals and other wood products. In addition, the Company is engaged in the manufacture and sale of synthesized charcoal, machine-made charcoal and essential oils and others.', 'Macau, , Macau', 151);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AIXI', 'STOCK', 'Xiao-I Corporation', 'NGM', 'Technology', 'Software - Application', 'Xiao-I Corp is a holding company mainly engaged in the provision of artificial intelligence (AI) services. The Company provides smart city, software business and architectural design AI services covering fundamental tech platform, conversation bot, cloud services, industry solutions and robotics solutions. The Company mainly conducts business in the domestic market.', 'Shanghai, , China', 162);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMCL', 'STOCK', 'Caledonia Mining Corporation Plc', 'ASE', 'Basic Materials', 'Gold', 'Caledonia Mining Corporation Plc is a gold production, exploration and development company focused on Zimbabwe. The Company owns a 64% stake in the gold-producing Blanket Mine (Blanket), 100% stakes in the Bilboes mine and the Motapa and Maligreen gold mining claims, all situated in Zimbabwe. The Blanket Gold Mine is a Zimbabwean gold mine, which operates at a depth of approximately 750 meters below surface and produced approximately 55,000 ounces of gold. Blanket also holds brownfield exploration and development projects both on the existing mine area and on its satellite properties which are within trucking distance of the Blanket metallurgical recovery plant. It also holds the Motapa gold exploration property in Southern Zimbabwe. The Maligreen project is a property situated in the Gweru mining district in the Zimbabwe Midlands. The Bilboes is a large, high grade gold deposit located approximately 75 kilometers (km) north of Bulawayo, Zimbabwe.', 'Saint Helier, , Jersey', NULL);\n